--Execute on Microsoft SQL Server 2016 or later, with sysadmin priviledges
DECLARE
	@SchemaName AS nvarchar(128) = 'tdq' -- All objects will be created in this schema
	,@Prefix AS nvarchar(128) = ''; -- All objects will be prefixed with this in their name
 
 
SET NOCOUNT ON;
DECLARE @SQL AS nvarchar(4000);
SET @SQL = 'SELECT OBJECT_ID(''[' + @SchemaName + '].[' + @Prefix + 'Box]'')';
DECLARE @ObjectIDTable AS TABLE(ObjectID int);
INSERT INTO @ObjectIDTable
EXEC (@SQL);
IF (SELECT TOP 1 ObjectID FROM @ObjectIDTable) IS NOT NULL THROW 50000, 'Box table already exists. Did you already run bootstrap? You can execute the unpack procedure, or drop the Box table, or change schema or prefix', 1
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable
SELECT ObjectName,ObjectType,ObjectSequence,CAST('' AS xml).value('xs:base64Binary(sql:column("DefinitionBinary"))','varbinary(max)')DefinitionBinary,DefinitionText,DefinitionDecimal,DefinitionDate,DefinitionBit INTO #BoxTable FROM (VALUES
