,(N'MailTemplateMeasureError','CONF',0,NULL,N'An error occurred while taking a measurement.\n\nMeasureID: $PARAMETER1$\n\nMeasurementID: $PARAMETER2$\n\nError Message: $PARAMETER3$',NULL,NULL,NULL)
