SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(DefinitionBinary) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Box'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
EXEC (@SQL);
SET @SQL ='INSERT INTO ['+@SchemaName+'].['+@Prefix+'Box] SELECT ObjectName,ObjectType,ObjectSequence,DefinitionBinary,DefinitionText,DefinitionDecimal,DefinitionDate,DefinitionBit FROM #BoxTable';
EXEC (@SQL);
SET @SQL =REPLACE(REPLACE((SELECT CAST(DECOMPRESS(DefinitionBinary) AS nvarchar(4000)) FROM #BoxTable WHERE ObjectName = 'Unpack'),'[$schema$]','['+@SchemaName+']'),'[$prefix$','['+@Prefix);
SET @SQL =REPLACE(REPLACE(@SQL,'[/$schema/$]','[$schema$]'),'[/$prefix/$','[$prefix$');
EXEC (@SQL);
SET @SQL ='EXEC ['+@SchemaName+'].['+@Prefix+'Unpack]'
EXEC (@SQL);
IF OBJECT_ID('tempdb..#BoxTable') IS NOT NULL DROP TABLE #BoxTable;